import Login from "./components/Login/login";
import { BrowserRouter,Routes,Route } from "react-router-dom";
import { Suspense,lazy } from "react";



function App() {
  return (
    <BrowserRouter>
    <div> 
      <Header/>
      </div>
      <Routes>
     <Route path="/" element={<Home/>}></Route>
    <Route path="/login" element={<Login/>}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
